import { Link } from 'react-router-dom';

const   Header = () =>{
    return(
        <header >

            <nav>
                <ul>
                    <li><Link className='Link' to='/'>Jobba Hub</Link> </li>
                    <li><Link className='Link' to='post-job/'>Post Job Opening</Link></li>        
                </ul>
            </nav>

        </header>

    );
}


export default Header;
